import React from 'react';
import About from './About';
import Projects from './Projects';
import Contact from './Contact';

const Header = ({ onClick }) => {
  const handleButtonClick = (page) => {
    onLinkClick(page);
  };

  return (
    <header>
      <h1>Alex Baptista</h1>
      <nav>
        <ul>
          <li onClick={() => handleButtonClick('about')}>About</li>
          <li onClick={() => handleButtonClick('portfolio')}>Projects</li>
          <li onClick={() => handleButtonClick('contact')}>Contact</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
